webpackJsonp([85862204635733],{878:function(a,e){a.exports={data:{post:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/posts/2018-03-12--angular-install-for-macos/index.md absPath of file >>> MarkdownRemark",html:'<p>Mac環境で <a href="https://angular.io/">Angular</a> のインストール方法を紹介します！</p>\n<br>\n<h1>まず<code class="language-text">Node.js</code>をインストールする</h1>\n<p>Angularを始めるには、まず<code class="language-text">Node.js</code>をインストールする必要があります。</p>\n<p><code class="language-text">Node.js</code>のインストール方法については、<a href="https://nodejs.org/ja/">Node.js公式サイト</a> を見るのをオススメします！</p>\n<p>ただし、<code class="language-text">Node 6.9.0</code> 以上のバージョンをインストールしてください。</p>\n<h2>npmバージョン確認</h2>\n<p>Node.jsと一緒に、npm - ノードパッケージ管理者（Node Package Manager）がインストールされます。</p>\n<div class="gatsby-highlight">\n      <pre class="language-cmd"><code class="language-cmd">npm -v</code></pre>\n      </div>\n<p>※ バージョン 3.0.0 以上</p>\n<br>\n<h1>TypeScriptをインストール</h1>\n<div class="gatsby-highlight">\n      <pre class="language-cmd"><code class="language-cmd">sudo npm install -g typescript</code></pre>\n      </div>\n<p>※ バージョン 2.1 以上</p>\n<br>\n<h1>Angular CLIをインストール</h1>\n<p>Angularは、コマンドラインでプロジェクトを作成し、管理できるツールを提供してます。</p>\n<p>これを使うと、プロジェクトの作成や、新しいコントローラーの追加などの作業を自動化できるらしいです。</p>\n<div class="gatsby-highlight">\n      <pre class="language-cmd"><code class="language-cmd">sudo npm install -g @angular/cli</code></pre>\n      </div>\n<p>※ 詳しくは、<a href="https://angular.io/guide/quickstart">Angular Docs</a> を参考。</p>\n<br>\n<h1>確認</h1>\n<p>インストールされたことを確認してみましょう！</p>\n<div class="gatsby-highlight">\n      <pre class="language-cmd"><code class="language-cmd">ng --help</code></pre>\n      </div>\n<p>これで Augular CLIのインストールが完了！</p>',fields:{slug:"/angular-install-for-macos/",prefix:"2018-03-12"},frontmatter:{title:"MacでAngularをインストール",subTitle:"",tags:["Angular","MacOS","Install"],cover:{childImageSharp:{resize:{src:"/static/angular-logo-c6d0bdd020fa4c26a8abfaec75365630-160fa.png"}}}}},author:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:"<p><strong>jslee</strong> <br>\n福岡在住外国籍WEBエンジニア👋 <br>\nPHPやVue.js、Angularなど書いてます！ 無類のラーメン好き🍜</p>"},footnote:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li><a href="../">lighthouse.log</a></li>\n</ul>'},site:{siteMetadata:{facebook:{appId:"152072888976323"}}}},pathContext:{slug:"/angular-install-for-macos/"}}}});
